import NameInput from "../atoms/inputs/nameInput";
import ReadPhone from "../atoms/inputs/readPhone";
import React, {useState} from "react";

interface PhoneProps{
    cell : string
}
export interface InfoProps {
    bpk : string,
    cName : string,
    cCell : string,
    cJumin : string,
    cMail : string,
    cPost : string,
    cAddr1 : string,
    cAddr2 : string,
    cJob : string,
    carNm : string,
    carUse : string,
    setInfo : React.Dispatch<React.SetStateAction<InfoProps>>
}
const InputForm = ({cell} : PhoneProps) => {
    const [info, setInfo] = useState<InfoProps>({
        bpk : '',
        cName : '',
        cCell : '',
        cJumin : '',
        cMail : '',
        cPost : '',
        cAddr1 : '',
        cAddr2 : '',
        cJob : '',
        carNm : '',
        carUse : ''
    });
    return (
        <form>
            <NameInput setInfo={setInfo}/>
            <ReadPhone cell={cell} />
        </form>
    )
}
export default InputForm;
